import Expenses from "./components/Expenses/Expenses";
function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 247.5,
      date: new Date(2022, 7, 11),
    },
    {
      id: "e2",
      title: "Buy Vegetables",
      amount: 47.3,
      date: new Date(2018, 3, 15),
    },
    {
      id: "e3",
      title: "Lunch at restaurant",
      amount: 85.99,
      date: new Date(2013, 5, 21)
    },
  ];
  return (
    <div>
      <h2>Expense Item!</h2>
      <Expenses items={expenses}/>
    </div>
  );
}

export default App;
